import React, { useState, useEffect } from 'react';
import './AIAssistant.css';

const AIAssistant = () => {
  const [aiStatus, setAiStatus] = useState('loading');
  const [systemInfo, setSystemInfo] = useState(null);
  const [messages, setMessages] = useState([
    { type: 'ai', content: 'Hello! I\'m your AI health assistant. Let me check the system status...' }
  ]);

  useEffect(() => {
    fetchAIStatus();
  }, []);

  const fetchAIStatus = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/ai/system-status');
      const data = await response.json();
      setSystemInfo(data);
      setAiStatus('ready');
      
      const statusMessage = {
        type: 'ai',
        content: `ü§ñ AI System Online! Running in ${data.mode} mode. I can help with cardiovascular analysis and health insights.`
      };
      setMessages(prev => [...prev, statusMessage]);
      
    } catch (error) {
      setAiStatus('error');
      setMessages(prev => [...prev, {
        type: 'ai',
        content: '‚ö†Ô∏è AI system temporarily unavailable. Please check that the backend server is running.'
      }]);
    }
  };

  const handleQuickAction = async (action) => {
    const userMessage = { type: 'user', content: `Requesting ${action}...` };
    setMessages(prev => [...prev, userMessage]);

    // Simulate AI response
    setTimeout(() => {
      let response = '';
      switch (action) {
        case 'health_check':
          response = '‚úÖ All systems operational! Your cardiovascular monitoring is active and ready.';
          break;
        case 'tips':
          response = 'üí° Quick Health Tip: Take deep breaths! Try 4-7-8 breathing: inhale for 4, hold for 7, exhale for 8.';
          break;
        case 'analysis':
          response = 'üìä Ready to analyze! Please start a PPG session or upload heart data for comprehensive analysis.';
          break;
        default:
          response = 'How can I help you with your heart health today?';
      }
      
      setMessages(prev => [...prev, { type: 'ai', content: response }]);
    }, 1000);
  };

  return (
    <div className="ai-assistant">
      <div className="ai-header">
        <div className="ai-avatar">ü§ñ</div>
        <div className="ai-title">
          <h3>AI Health Assistant</h3>
          <span className={`ai-status status-${aiStatus}`}>
            {aiStatus === 'loading' && '‚è≥ Loading...'}
            {aiStatus === 'ready' && '‚úÖ Online'}
            {aiStatus === 'error' && '‚ö†Ô∏è Offline'}
          </span>
        </div>
      </div>

      <div className="messages-container">
        {messages.map((message, index) => (
          <div key={index} className={`message ${message.type}`}>
            <div className="message-content">
              {message.content}
            </div>
          </div>
        ))}
      </div>

      <div className="quick-actions">
        <button 
          className="quick-btn"
          onClick={() => handleQuickAction('health_check')}
          disabled={aiStatus !== 'ready'}
        >
          üè• Health Check
        </button>
        <button 
          className="quick-btn"
          onClick={() => handleQuickAction('tips')}
          disabled={aiStatus !== 'ready'}
        >
          üí° Quick Tips
        </button>
        <button 
          className="quick-btn"
          onClick={() => handleQuickAction('analysis')}
          disabled={aiStatus !== 'ready'}
        >
          üìä Analysis
        </button>
      </div>

      {systemInfo && (
        <div className="system-info">
          <h4>System Capabilities</h4>
          <ul>
            {systemInfo.capabilities?.comprehensive_analysis && <li>‚úÖ Comprehensive Analysis</li>}
            {systemInfo.capabilities?.real_time_processing && <li>‚úÖ Real-time Processing</li>}
            {systemInfo.capabilities?.risk_assessment && <li>‚úÖ Risk Assessment</li>}
            {!systemInfo.capabilities?.explainable_predictions && <li>‚è≥ Advanced AI (Install dependencies)</li>}
          </ul>
        </div>
      )}
    </div>
  );
};

export default AIAssistant;
